import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Collapse from 'react-bootstrap/Collapse';
import { Row, Col } from 'react-bootstrap';
import Card from 'react-bootstrap/Card';
import Offcanvas from 'react-bootstrap/Offcanvas';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars } from '@fortawesome/free-solid-svg-icons';



import './navbar.css';
function NavBar() {

  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);



  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary border-bottom nav">
        <Container>
          <Navbar.Brand href="#home">Musicia</Navbar.Brand>
          <Navbar.Toggle className='toggle'>
            <Button variant='btn' onClick={handleShow}>
              <FontAwesomeIcon icon={faBars}></FontAwesomeIcon>
            </Button>
          </Navbar.Toggle>
        </Container>
      </Navbar>
      <Row className='main'>
        <Col lg="2" className="d-none d-lg-block">
          <Na id="sidebar">
            <ul className="list-unstyled components">
              <li className="active">
                <a>Home</a>
              </li>
              <li>
                <a href="#">Portfolio</a>
              </li>
              <li>
                <a href="#">Contact</a>
              </li>
            </ul>
          </Na>
        </Col>
        <Col lg="10" className='cont'>
          main
        </Col>
      </Row>
      <Offcanvas show={show} onHide={handleClose}>
        <Offcanvas.Header closeButton>
          <Offcanvas.Title>Musicia</Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body className='off'>
          <nav id="sidebar">
            <ul className="list-unstyled components">
              <li class="active">
                <a>Home</a>
              </li>
              <li>
                <a href="#">Portfolio</a>
              </li>
              <li>
                <a href="#">Contact</a>
              </li>
            </ul>
          </nav>
        </Offcanvas.Body>
      </Offcanvas>

    </div>

  );
}

export default NavBar;
